import React from 'react';
import { Text, StyleSheet } from 'react-native'

const ConsultDoctor = () =>{
    return <Text style={styles.textStyle}>ConsultDoctor</Text>;
}

const styles = StyleSheet.create({
    textStyle: {
        fontSize: 30
    }
});

export default ConsultDoctor;
